import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppComponent } from './app.component';
import { HeaderComponent } from './header/header.component';
import { AdvertisementComponent } from './advertisement/advertisement.component';

import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { RouterModule } from '@angular/router';  
import { SlickCarouselModule } from 'ngx-slick-carousel';
import { DisplayPdtComponent } from './display-pdt/display-pdt.component';
import { HttpClientModule } from '@angular/common/http';
import { SearchResultComponent } from './search-result/search-result.component';
import { EcommServiceService } from './ecomm-service.service';
import { AppRoutingModule } from './app-routing.module';
import { DashboardComponentComponent } from './dashboard/dashboard-component/dashboard-component.component';
import { DashboardModule } from './dashboard/dashboard.module';

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    AdvertisementComponent,
    DisplayPdtComponent,
    SearchResultComponent,
    DashboardComponentComponent,

  ],
  imports: [
    BrowserModule,
    HttpClientModule,
    SlickCarouselModule,
    ReactiveFormsModule,
    FormsModule,
    RouterModule.forRoot([
      // {path:'advertisement', component:AdvertisementComponent},
      // {path:'header',component:HeaderComponent},
      {path:'display-pdt',component:DisplayPdtComponent},
      {path:'search-result', component:SearchResultComponent},

    ]),
    AppRoutingModule,
    DashboardModule

  ],
  providers: [EcommServiceService],
  bootstrap: [DashboardComponentComponent]
})
export class AppModule { }
